import React from 'react';
import ReactDOM from 'react-dom';
import './App.css'

const App = () => {
    return (
        <>
            <div className="box">
                <h1 className="heading">Heading</h1>
                <div className="btnbox">
                    <button className="incr btn">increment</button>
                    <button className="decr btn" onClick="decr">decrement</button>
                </div>
            </div>
        </>
        );
}
export default App;
